import React, { useState } from "react";
import { Button, Typography, makeStyles, Container } from "@material-ui/core";
import ClipLoader from "react-spinners/ClipLoader";
import useToken from "../Hooks/useToken";
import { TextInput, Picker } from "../Components";

import { validateEmail } from "../Utils/Validations";

import { useHistory } from "react-router-dom";

const axios = require("axios").default;

const departamentos = [
  "Montevideo",
  "Artigas",
  "Canelones",
  "Cerro Largo",
  "Colonia",
  "Durazno",
  "Flores",
  "Florida",
  "Lavalleja",
  "Maldonado",
  "Paysandu",
  "Rio Negro",
  "Rivera",
  "Rocha",
  "Salto",
  "San Jose",
  "Soriano",
  "Tacuarembo",
  "Treinta y Tres",
];

const places = require("../vacunatorios.json");

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: "100%",
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

const Agenda = () => {
  const classes = useStyles();
  const history = useHistory();
  const { token } = useToken();

  const [errorMessage, setErrorMessage] = useState("");

  const [loading, setLoading] = useState(false);
  const [userPhone, setUserPhone] = useState("");
  const [email, setEmail] = useState("");

  const [emailError, setEmailError] = useState(false);
  const [numberError, setNumberError] = useState(false);

  const [department, setDepartment] = useState("");
  const [location, setLocation] = useState("");

  const handleInput = (e) => {
    setErrorMessage("");
    const { value, name } = e.target;
    if (name === "email") {
      setEmail(value);
      setEmailError(!validateEmail(value));
    } else if (name === "phone") {
      setUserPhone(value);
      setNumberError(value.length < 7);
    } else {
    }
  };

  const createEvent = () => {
    const { apellidos, nombre, ci } = token;
    const data = {
      nombre: nombre,
      apellidos: apellidos,
      ci: ci,
      locacion: location,
      mail: email,
      telefono: userPhone,
    };
    setLoading(true);
    setErrorMessage("");
    axios
      .post("http://localhost:8080/coronavirus/vacunacion", data)
      .then(function (response) {
        const { data } = response;
        if (data?.message === "Ya se agendo") {
          setErrorMessage("Usuario ya agendado");
          setLoading(false);
          setLoading(false);
        } else if (data?.message === "Not person found") {
          setErrorMessage("Persona no habilitada");
          setLoading(false);
        } else {
          history.push({
            pathname: "/date",
            state: { detail: data },
          });
          setLoading(false);
        }
      })
      .catch(function (error) {
        setLoading(false);
        console.log("Error", error);
      });
  };

  return (
    <Container component="main" maxWidth="xs">
      <div className={classes.paper}>
        <Typography component="h1" variant="h5">
          Formulario de Registro
        </Typography>

        <form className={classes.form} noValidate>
          <TextInput
            id={"email"}
            onChange={handleInput}
            label={"Email"}
            name={"email"}
            error={emailError}
            errorMessage={"Ingrese un email valido"}
          />
          <TextInput
            id={"phone"}
            onChange={handleInput}
            label={"Telefono"}
            name={"phone"}
            error={numberError}
            errorMessage={"Ingrese un telefono valido"}
            type={"number"}
          />
          <Picker
            pickerName={"Departamento"}
            options={departamentos}
            option={department}
            setOption={setDepartment}
          />
          <Picker
            pickerName={"Lugar"}
            options={department ? places[department] : [""]}
            option={location}
            setOption={setLocation}
          />

          <ClipLoader
            color={"blue"}
            loading={loading}
            css={{ marginTop: 20 }}
            size={30}
          />

          {errorMessage && (
            <div style={{ color: "red", marginTop: 20 }}> {errorMessage} </div>
          )}

          <Button
            fullWidth
            disabled={
              loading ||
              emailError ||
              !department ||
              !location ||
              errorMessage ||
              numberError
            }
            variant="contained"
            color="primary"
            className={classes.submit}
            onClick={createEvent}
          >
            Reservar Cupon
          </Button>
        </form>
      </div>
    </Container>
  );
};

export default Agenda;
